/** @jsxImportSource @emotion/react */
import { useState } from "react";
import styled from "@emotion/styled";
import { Link } from "react-router-dom";
import Nav from "../components/Nav";
import React from "react";

const HomeButton = styled.button`
  padding: 32px;
  background-color: green;
  color: lime;
  font-size: 24px;
  font-weight: bold;
  &:hover {
    background-color: white;
  }
`;

function About() {
  return (
    <div className="About" style={{ backgroundColor: "pink" }}>
      <Nav />
      <div className="aboutText">
        <Link to="/"><HomeButton>Home</HomeButton></Link>
        <h2>Hi there!</h2>
        <br />
        <p>
          My name is John and I am a fullstack developer based out of beautiful
          British Columbia. I design user interfaces and bring them to life
          using modern frameworks and tools. I'd love to get in touch!
        </p>
        <br />
        <p>hello@johnschriemer.com</p>
      </div>
    </div>
  );
}

export default About;
